import React from "react";
import { Navbar, Nav, Button } from "react-bootstrap";
import logo from "../../assets/img/ONEE.jpeg";
import "./FooterButtons.css";
import { Link } from "react-router-dom";
import { LinkContainer } from "react-router-bootstrap";
export const Header = () => {
  return (
    <Navbar collapseOnSelect bg="" variant="dark" expand="md">
      <Navbar.Brand>
        {" "}
        <img src={logo} alt="logo" width="65px" />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          {/*<Link to="/dashboard" className="neonBTN">
            <button className="HeaderBTN">L'interface</button>
          </Link>
          <Link to="/tickets" className="neonBTN">
            <button className="HeaderBTN">Les Tickets</button>
          </Link>
          <Link to="/" className="neonBTN">
  <button className="HeaderBTN">Se Deconnecter</button></Link>*/}
          <LinkContainer to="/dashboard">
            <Nav.Link>
              <button className="HeaderBTN">L'interface</button>
            </Nav.Link>
          </LinkContainer>
          <LinkContainer to="/tickets">
            <Nav.Link>
              <button className="HeaderBTN">Les Tickets</button>
            </Nav.Link>
          </LinkContainer>
          <Nav.Link>
            <button className="HeaderBTN">Se Deconnecter</button>
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};
